import { hydrate } from 'react-dom';
import Header from './Header'



function App() {

  const [group, setGroup] = React.useState({
    title: '',
  })
  function handleChange(event) {
    setGroup(prevGroup => {
      return {
        ...prevGroup,
        [event.target.name]: event.target.value
      }
    })
  }
  console.log(group)
  return (
    <div className="App">
      <Header
        onChange={handleChange}
        title={group.title}
      />
    </div>
  );
}

export default App;
